<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>破心交易平台</title>
    <link
      rel="stylesheet"
      href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.7.2/css/all.min.css"
      crossorigin="anonymous"
    />
    <script>
      // 禁止F12开发者工具
      document.addEventListener('keydown', function(e) {
        if (e.key === 'F12' || 
            (e.ctrlKey && e.shiftKey && e.key === 'I') || 
            (e.ctrlKey && e.shiftKey && e.key === 'J') ||
            (e.ctrlKey && e.key === 'U')) {
          e.preventDefault();
          alert('开发者工具已禁用');
        }
      });
      
      // 禁止右键菜单
      document.addEventListener('contextmenu', function(e) {
        e.preventDefault();
      });
      
      // 禁止选择和复制
      document.addEventListener('selectstart', function(e) {
        e.preventDefault();
      });
    </script>

这些平台通常提供评估项目，交易员通过考核后可获得资金支持。`}]},{id:3,name:"资本配置计划",icon:"fa-money-bill-wave",questions:[{id:1,question:"什么是资本配置计划？",answer:"资本配置计划是指根据不同交易策略或交易者的表现、风险状况和潜在投资回报在其之间分配财务资源的过程。"},{id:2,question:"如何参与资本配置计划？",answer:"请联系您的团队经理获取资本配置计划的详细信息和参与资格。"}]},{id:4,name:"交易员资金",icon:"fa-money-bill-wave",questions:[{id:1,question:"自营公司如何为交易员提供资金？",answer:"自营公司为交易员提供资金以赚取其部分利润，这构成了其收入的主要部分，并且还可能通过订阅、加入收费和出售教育课程获得收入。"},{id:2,question:"交易员如何获得资金支持？",answer:"交易员需要通过评估测试，证明其交易能力和风险管理能力后，可获得公司提供的交易资金支持。"}]},{id:5,name:"加入优势",icon:"fa-cogs",questions:[{id:1,question:"加入自营交易公司有哪些优势？",answer:"加入自营交易公司可以让交易者获得更多的资本、先进的交易工具以及与专业交易者建立联系的机会。会员可免费得到训练课程，通过顶尖交易员专业学习提升通过率，且无需自己出报名费或注册费。"},{id:2,question:"资金分配计划的具体优势是什么？",answer:"见习交易员通过训练及连续四周的小额实盘测验即可获得200000美金的真实操作资金，最多可保留90%的利润分成(60%起)。该计划基于真实交易账户，为交易者提供真实透明的体验。"}]},{id:6,name:"风险提示",icon:"fa-exclamation-triangle",questions:[{id:1,question:"自营交易有哪些风险？",answer:"自营交易像任何交易一样具有固有风险，但公司往往通过冒资本风险来承担大部分风险，尽管交易员面临失去订阅费或加入费以及无法通过公司的交易挑战的风险。"},{id:2,question:"如何降低交易风险？",answer:"建议严格遵守风险管理规则，控制仓位大小，并持续学习交易技巧。"}]},{id:7,name:"经验要求",icon:"fa-user-check",questions:[{id:1,question:"我需要成为一名经验丰富的交易员才能加入吗?",answer:"加入资本配置计划并不总是需要丰富的经验，因为每个计划都有自己特定的一套要求。"},{id:2,question:"资本配置计划对经验有什么具体要求？",answer:"不同计划对经验要求不同，有些计划适合初学者，有些则需要一定交易经验。请咨询您的团队经理了解具体计划的资格要求。"}]},{id:8,name:"免费条件",icon:"fa-unlock-alt",questions:[{id:1,question:"我可以免费加入资本配置计划吗?",answer:"是的!破心成立旨在为有才华的交易者提供获得资金的机会，你如果顺利通过10个交易日和为期4周的测评，即可无需支付订阅费或加入费。"},{id:2,question:"测评的具体要求是什么?",answer:"需要在10个交易日内保持稳定盈利，并通过4周的风险管理评估，具体标准请咨询您的团队经理。"}]},{id:9,name:"成长之路",icon:"fa-gift",questions:[{id:1,question:"破心交易如何帮助交易者成长?",answer:"为全年龄段(50岁以下)提供不同的六个渐进阶段的系统化培训课程，为客户提供通往潜在成功的结构化旅程。其精致的仪表板为您提供所需的所有见解，让您自信地培养专业交易技能。其他功能包括独家在线交易室、实时分析和大量免费教育材料。"},{id:2,question:"六个阶段具体是什么?",answer:"六个阶段从基础认知到高级策略逐步提升：1)交易基础 2)风险管理 3)技术分析 4)心理训练 5)策略构建 6)实战优化。每个阶段都有对应的课程和考核。"}]},{id:10,name:"如何开始",icon:"fa-play",questions:[{id:1,question:"加入自营公司有哪些不同要求？",answer:"加入自营公司的入职要求可能有很大差异。例如，如果一家自营公司的交易员在公司实体办公室工作，配备先进的软件和硬件，并投入大量精力支持和培训他们，那么这家公司的要求就会很严格，筛选过程会很长，而且空缺职位数量有限。"},{id:2,question:"远程自营企业有什么特点？",answer:"远程运营且仅向交易者提供资金账户的自营企业让有才华的交易者更容易加入。交易者通常会在参加挑战或评估期之前支付加入费或订阅费。他们必须用一定数量的资本来展示自己的交易能力，自营公司会设定最大回撤和利润目标。如果交易者成功完成挑战，他们将有资格加入该计划并在未来获得额外融资。随着最近监管法规的变化，基于订阅费的模式即将结束，许多交易者选择使用真实交易账户且不向交易者收取任何前期费用的程序。"}]}];function S7(){const[y,n]=o.useState(1),[S,d]=o.useState([]),K=b=>{S.includes(b)?d(S.filter(q=>q!==b)):d([...S,b])};return W.jsxs("div",{className:"min-h-screen flex flex-col bg-gray-900",children:[W.jsx(vu,{}),W.jsx("main",{className:"flex-1 py-8",children:W.jsxs("div",{className:"container mx-auto px-4",children:[W.jsx("h1",{className:"text-3xl font-bold text-yellow-500 mb-8",children:"常见问题解答"}),W.jsx("div",{className:"grid grid-cols-2 sm:grid-cols-3 md:grid-cols-4 lg:grid-cols-5 gap-3 mb-8",children:ze.map(b=>W.jsxs("button",{onClick:()=>n(b.id),className:`px-3 py-2 rounded-lg flex items-center justify-center transition-colors text-sm ${y===b.id?"bg-yellow-600 text-white":"bg-gray-700 text-gray-300 hover:bg-gray-600"}`,children:[W.jsx("i",{className:`fas ${b.icon} mr-1`}),b.name]},b.id))}),W.jsxs("div",{className:"bg-gray-800 rounded-xl p-6 border border-gray-700",children:[W.jsxs("h2",{className:"text-xl font-semibold text-white mb-6",children:[W.jsx("i",{className:`fas ${ze.find(b=>b.id===y)?.icon} mr-2 text-yellow-500`}),ze.find(b=>b.id===y)?.name]}),W.jsx("div",{className:"space-y-4",children:ze.find(b=>b.id===y)?.questions.map(b=>W.jsxs("div",{className:"border-b border-gray-700 pb-4 last:border-0",children:[W.jsxs("button",{onClick:()=>K(b.id),className:"w-full text-left flex justify-between items-center",children:[W.jsx("span",{className:"text-lg font-medium text-white",children:b.question}),W.jsx("i",{className:`fas ${S.includes(b.id)?"fa-minus":"fa-plus"} text-yellow-500`})]}),S.includes(b.id)&&W.jsx("div",{className:"mt-3 text-gray-300 pl-2",children:b.answer})]},b.id))})]})]})}),W.jsx(Xu,{})]})}function p7(){return W.jsxs("div",{className:"min-h-screen flex flex-col bg-gray-900",child
